import React from "react";
import "./FoodAndWine.css";
import { Tabs, Tab, Row, Col } from "react-bootstrap";
import { ImSpoonKnife } from "react-icons/im";
import { useState } from "react";

const FoodAndWine = () => {
  const [key, setKey] = useState("home");

  return (
    <div>
      <div className="title">
        <Row>
          <Col xs={9}>
            <h2>
              Food & Wine &nbsp;
              <ImSpoonKnife />
            </h2>
          </Col>
        </Row>
        <hr />
        <Tabs
         
          activeKey={key}
          onSelect={(k) => setKey(k)}
          transition={false}
          className="mb-6"
        >
          <Tab eventKey="home" title="Big Categories">
            <>Tab1</>
          </Tab>
          <Tab eventKey="profile" title="Day Type">
            <>Tab2</>
          </Tab>
          <Tab eventKey="contact" title="Specific Foods">
            <>Tab3</>
          </Tab>
        </Tabs>
      </div>
    </div>
  );
};

export default FoodAndWine;
